[[File:Coins detail.png|left|120px|A detailed image of Coins.]]
'''Coins''' (also referred to as '''gold pieces''', '''gp''', '''gold''', or simply '''money''') are the most common form of [[Currencies|currency]] in [[Gielinor]]. They are used among players and [[non-player character]]s alike to exchange for items and services.

Players often refer to one thousand (1,000) coins as ''1k'' and one million (1,000,000) coins as ''1m'' or ''1mil''. Both can be applied to larger numbers, for example, ''10m'' refers to ten million coins (10,000,000). ''1b'' or ''1bil'' refers to one billion coins (1,000,000,000).

[[Alchemy spells]], which create coins, cannot be cast on coins. If a player attempts it, a message will inform the player that "''Coins are already made of gold.''" Curiously, other items made of gold, such as [[gold ore]] and [[gold bar]]s, can be turned into coins with Alchemy spells.

Players can ask [[Anja]] in [[Rimmington]] for some free stuff, after the dialogue she will give 1 to 3 coins.

==Terminology==
[[File:Coins interface.png|thumb|Coins as they appear on the welcome screen and the [[Clan coffer]]'s interface.]]
Alternate terms for coins have seldom seen official usage since ''[[RuneScape Classic]]'' was replaced by ''[[RuneScape 2]]''. Very few [[NPC]]s use any other term than "coins," a few examples being the [[Blast Furnace Foreman|Blast Furnace foreman]] in [[Keldagrim]], who calls them "GP" as he prefers to associate coins with the metal at the expense of proper terminology, and the glassblower on [[Entrana]], who calls them "gold pieces." The term "gp" is sometimes used in abbreviations such as on the right-click menu of the [[Al-Kharid]] gates, which includes the option "Pay-toll(10gp)" to pay the toll and go through.

==Real world trading==
Some players purchase coins in exchange for real-world money through a third party. This is known as [[real world trading]]. Although players can potentially gain monetary value within ''RuneScape'' by such means, this method is '''not''' recommended, as Rule #12 of the ''RuneScape'' Code of Conduct forbids the trading of ''RuneScape'' items for items outside of ''RuneScape'', and if engaged in can result in a player [[ban]].

With the release of [[Old school bond]]s, however, players may legally acquire ''RuneScape'' coins using real-world money, albeit indirectly, by buying bonds from [[Jagex]] and selling them in-game to other players or on the [[Grand Exchange]].

