==Trivia==
[[File:Coins high detail.png|thumb|170px|Coins dropped by [[mouse|mice]] during [[Grim Tales]].]]
* Coins appear in the inventory as plain flat discs, but during [[Grim Tales]] and in [[The Mimic]] fight, it is revealed that coins have more intricate designs imprinted on their faces.
* During the [[Shilo Village]] [[quest]], there is an [[Coins (Shilo Village)|item that looks like coins]] in one of the tunnels; however, it can be picked up only by use of [[Telekinetic Grab]]. These coins are non-stackable and untradeable. If a player tries to pick them up without Telekinetic Grab, they will be attacked and the coins will turn to dust.
* The maximum number of coins in a stack is {{formatexpr|2^31-1}}, because ''RuneScape'' uses 32-bit signed integers to store values, which are unable to represent a higher number. Theoretically it would be possible to use higher values by storing them in larger data types like ''long'' (64-bit integer with a maximum value of 9,223,372,036,854,775,807).

